// Layout
import LayoutEspecial from '../Layouts/LayOutMenu';


// Pages
import MenuEspecialidades from '../Pages/AdminRestaurante/Menus/Especialidades';
import Login from '../Pages/Login/login';
import InsertBebidaHelada from '../Pages/AdminRestaurante/Forms/AgregarBebidasHeladas';
import InsertLicor from '../Pages/AdminRestaurante/Forms/AgregarLicores';
import InsertGaseosa from '../Pages/AdminRestaurante/Forms/addGaseosas';
import InsertBebidaCaliente from '../Pages/AdminRestaurante/Forms/formBebCalientes';
import InsertVino from '../Pages/AdminRestaurante/Forms/formAddVinos';
import InsertMesa from '../Pages/AdminRestaurante/Forms/formAddMesa';
import InsertPuesto from '../Pages/AdminRestaurante/Forms/FormAddPuestos';
import InsertEspecial from '../Pages/AdminRestaurante/Forms/formAddEspeciales';
import InsertBuffet from '../Pages/AdminRestaurante/Forms/formAddBuffet';
import InsertEmpleado from '../Pages/AdminRestaurante/Forms/formAddEmpleados';
import InsertUser from '../Pages/AdminSeguridad/Forms/AgregarUsuario';
import InsertConsecu from '../Pages/AdminSeguridad/Forms/AgregarConsecutivos';
import InsertRol from '../Pages/AdminSeguridad/Forms/AgregarRoles';
import InsertPais from '../Pages/AdminSeguridad/Forms/AgregarPaises';
import InsertUM from '../Pages/AdminSeguridad/Forms/AgregarUnidadesMedidas';
import InsertComestible from '../Pages/AdminSistema/Form/formAddComestibles';
import InsertDesechable from '../Pages/AdminSistema/Form/formAddDesechablesEmpaques';
import InsertEquipos from '../Pages/AdminSistema/Form/formAddEquiposUtencilios';
import InsertLimpieza from '../Pages/AdminSistema/Form/formAddLimpiezaHigiene';
import InsertTecnologia from '../Pages/AdminSistema/Form/formAddTecnologia';
import InsertProveedor from '../Pages/AdminSistema/Form/formAddListProveedores';
import InsertMarca from '../Pages/AdminSistema/Form/formAddMarca';
//LISTAS RESTAURANTES
import ListaGaseosas from "../Pages/AdminRestaurante/Listas/listGaseosas";
import ListaLicores from "../Pages/AdminRestaurante/Listas/listaLicores";
import ListaMesas from "../Pages/AdminRestaurante/Listas/listaMesas";
import ListaBebCaliente from "../Pages/AdminRestaurante/Listas/listBebCalientes";
import ListaBuffet from "../Pages/AdminRestaurante/Listas/listBuffet";
import ListaEmpleado from "../Pages/AdminRestaurante/Listas/listEmpleados";
import ListaEspeciales from "../Pages/AdminRestaurante/Listas/listEspeciales";
import ListaPuestos from "../Pages/AdminRestaurante/Listas/listPuestos";
import ListaVinos from "../Pages/AdminRestaurante/Listas/listVinos";
import ListaBebHeladas from "../Pages/AdminRestaurante/Listas/listaBebHeladas";


const routes = [{

    path: '/AdminRestaurante',
    component: LayoutEspecial,
    exact: false,
    routes: [
        {
            path: "/AdminRestaurante/Especialidades",
            component: MenuEspecialidades,
            exact: true

        },
        {
            path: "/AdminRestaurante/AgregarBebidaHelada",
            component: InsertBebidaHelada,
            exact: true
        },
        {
            path: "/AdminRestaurante/AgregarLicores",
            component: InsertLicor,
            exact: true
        },
        {
            path: "/AdminRestaurante/AgregarBebidaGaseosa",
            component: InsertGaseosa,
            exact: true
        },
        {
            path: "/AdminRestaurante/AgregarBebidaCaliente",
            component: InsertBebidaCaliente,
            exact: true
        },
        {
            path: "/AdminRestaurante/AgregarVino",
            component: InsertVino,
            exact: true
        },
        {
            path: "/AdminRestaurante/AgregarMesa",
            component: InsertMesa,
            exact: true
        },
        {
            path: "/AdminRestaurante/AgregarPuestos",
            component: InsertPuesto,
            exact: true
        },
        {
            path: "/AdminRestaurante/AgregarEspecialidades",
            component: InsertEspecial,
            exact: true
        },
        {
            path: "/AdminRestaurante/AgregarBuffet",
            component: InsertBuffet,
            exact: true
        },
        {
            path: "/AdminRestaurante/AgregarEmpleado",
            component: InsertEmpleado,
            exact: true
        },
        {
            path: "/AdminRestaurante/ListaGaseosas",
            component: ListaGaseosas,
            exact: true
        },
        {
            path: "/AdminRestaurante/ListaLicores",
            component: ListaLicores,
            exact: true
        },
        {
            path: "/AdminRestaurante/ListaMesas",
            component: ListaMesas,
            exact: true
        },
        {
            path: "/AdminRestaurante/ListaBebCaliente",
            component: ListaBebCaliente,
            exact: true
        },
        {
            path: "/AdminRestaurante/ListaBuffet",
            component: ListaBuffet,
            exact: true
        },
        {
            path: "/AdminRestaurante/ListaEmpleados",
            component: ListaEmpleado,
            exact: true
        },
        {
            path: "/AdminRestaurante/ListaEspeciales",
            component: ListaEspeciales,
            exact: true
        },
        {
            path: "/AdminRestaurante/ListaPuestos",
            component: ListaPuestos,
            exact: true
        },
        {
            path: "/AdminRestaurante/ListaVinos",
            component: ListaVinos,
            exact: true
        },
        {
            path: "/AdminRestaurante/ListaBebHeladas",
            component: ListaBebHeladas,
            exact: true
        }

    ]

},
{
    path: '/',
    component: Login,
    exact: true

},
{
    path: '/AdminSeguridad',
    component: LayoutEspecial,
    exact: false,
    routes: [

        {
            path: "/AdminSeguridad/AgregarUsuario",
            component: InsertUser,
            exact: true
        },
        {
            path: "/AdminSeguridad/AgregarConsecutivo",
            component: InsertConsecu,
            exact: true
        },
        {
            path: "/AdminSeguridad/AgregarConsecutivo",
            component: InsertConsecu,
            exact: true
        },
        {
            path: "/AdminSeguridad/AgregarRol",
            component: InsertRol,
            exact: true
        },
        {
            path: "/AdminSeguridad/AgregarPais",
            component: InsertPais,
            exact: true
        },
        {
            path: "/AdminSeguridad/AgregarUnidadMedida",
            component: InsertUM,
            exact: true
        }

    ]

},
{
    path: '/AdminSistema',
    component: LayoutEspecial,
    exact: false,
    routes: [

        {
            path: "/AdminSistema/AgregarComestibles",
            component: InsertComestible,
            exact: true
        },
        {
            path: "/AdminSistema/AgregarDesechables",
            component: InsertDesechable,
            exact: true
        },
        {
            path: "/AdminSistema/AgregarEquipos",
            component: InsertEquipos,
            exact: true
        },
        {
            path: "/AdminSistema/AgregarLimpiezaHiguiene",
            component: InsertLimpieza,
            exact: true
        },
        {
            path: "/AdminSistema/AgregarTecnologia",
            component: InsertTecnologia,
            exact: true
        },
        {
            path: "/AdminSistema/AgregarProveedor",
            component: InsertProveedor,
            exact: true
        },
        {
            path: "/AdminSistema/AgregarMarca",
            component: InsertMarca,
            exact: true
        }

    ]

}
];


export default routes;
